import React, {Component} from 'react';
import {Container, Form} from "react-bootstrap";
import SubTitle from "../SubTitle/SubTitle";
import SimpleText from "../SimpleText/SimpleText";

function HowToContact(props) {
        return (
            <div>
                <div className="how-to-contact-container">
                   <SubTitle text="Для запису на індивідуальні консультації вам потрібно:"/>
                        <SimpleText text="Звязатись зі мною за телефоном +380 50 375 45 76"/>
                        <SimpleText text="Домовитись про зручну для вас дату та час"/>


                   <SubTitle text="Для запису на групові заняття потрібно:"/>
                    <SimpleText text="У верхньому меню натиснути на події"/>
                    <SimpleText text="Обрати групове заняття яке вас цікавить"/>
                    <SimpleText text="Заповнити форму зворотнього зв'язку і наш менеджер зателефонує вам"/>

                </div>
            </div>
        );

}

export default HowToContact;
